import React from "react";
import "./Slide.css"

const Slide = ({ idx, title, url ,cN}) => {
  return (
    <div className={cN}>

      <div className="slide_title">{title}</div>
      <iframe
        title="YouTube Video"
        width="800"
        height="500"
        src={url}
        frameBorder="0"
        allowFullScreen
      ></iframe>

    </div>
  );
};

export default Slide;
